CREATE TABLE IF NOT EXISTS TTSTUDENTS(
IDS INTEGER  NOT NULL AUTO_INCREMENT, 
STUDENTID VARCHAR(32), 
CIVIL CHAR(1), 
LASTNAME VARCHAR(128), 
FIRSTNAME VARCHAR(128), 
EMAIL VARCHAR(128), 
GRADE INTEGER, 
CLASSES VARCHAR(16), 
PHONE VARCHAR(32), 
MOBILE VARCHAR(32), 
ANNEE INTEGER, 
MATH INTEGER, 
ENGLISH INTEGER, 
TOTAL INTEGER, 
COMMENTS VARCHAR(32), 
DELETED CHAR(1), 
PRIMARY KEY (IDS) 			
)ENGINE=MyISAM DEFAULT CHARSET=latin1 COLLATE=latin1_general_ci AUTO_INCREMENT=1;

 

